      SELECT ALL + + col1 / - col1 + + ( cor0.col2 + - col2 ) * cor0.col2 AS col1 FROM tab0 AS cor0;
  - name: tab0

outputs:
  - name: q11363.out
    data: |
      -1
      -1
      -1
